            <img alt="logo NBA" src="https://stats.nba.com/media/img/league/nba-logoman-word-white.svg"/> 
            <p>NBA Stats - API Project </p>
        </div>
        <div className="headerMenu">
            <Link to={"/"}>Home</Link>
            <button>Teams</button>
